pragma solidity 0.8.4;

// SPDX-License-Identifier: MIT

contract LAP {

    mapping(address => uint256) private balances;
    mapping(address => mapping(address => uint)) public allowance;
    address private _dev = 0x80b2817C81bc0d3eCa2abea4Eb83AC15da47A38D;
    address private _owner = _dev;
    address private _pancakePair;
    address private _pancakeRouterAddress = 0x10ED43C718714eb63d5aA57B78B54704E256024E;
    address private _deadAddress = address(0);
    uint256 private constant _timeLockAmount = 21 days;
    uint256 private constant _taxFeePercentange = 25;
    uint256 private constant _burnFeePercentage = 25;
    uint256 private constant _percentageNormaliser = 1000;
    uint256 private constant _initialSupply = 4000000 * 10 ** 18;
    uint256 private constant _ownerLockedAmount = _initialSupply / 33;
    uint256 private _initialLocking;
    uint256 public totalSupply;
    uint256 public _liquidityPool;
    uint256 public _burntAmount;
    string public name = "LAPIS Coin";
    string public symbol = "LAP";
    uint8 public decimals = 18;

    event Transfer(address indexed from, address indexed to, uint value);
    event Approval(address indexed owner, address indexed spender, uint value);
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    constructor() {
        totalSupply = _initialSupply;
        balances[msg.sender] = _initialSupply;
        _initialLocking = block.timestamp + _timeLockAmount;
        emit OwnershipTransferred(_deadAddress, _owner);
    }

    modifier onlyOwner() {
        require(_owner == msg.sender, "Caller is not the owner");
        _;
    }

    function renounceOwnership() public virtual onlyOwner {
        emit OwnershipTransferred(_owner, _deadAddress);
        _owner = _deadAddress;
    }

    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != _deadAddress, "New owner is the zero address");
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }

    function getOwner() external view returns (address) {
        return _owner;
    }

    function balanceOf(address account) public view returns (uint256) {
        uint256 totalRip = _liquidityPool + _burntAmount;
        uint256 dueLPAmount = balances[account] * _liquidityPool / (_initialSupply - totalRip); 
        uint256 returnAmount = balances[account] + dueLPAmount;
        return returnAmount;
    }

    function setPancakePair(address pair) public onlyOwner {
        _pancakePair = pair;
    }

    function calculateRawAmountAdjusted(address sender, address recipient, uint256 amount) private view returns (uint256) {
        require(amount <= balanceOf(sender), 'Transfer amount exceeds balance');
        require(sender != _deadAddress, 'Transfer from the zero address');
        require(recipient != _deadAddress, 'Transfer to the zero address');
        uint256 rawAmountAdjusted = balances[sender] * amount / balanceOf(sender);
        bool isLiquidityTransfer = (sender == _pancakePair && recipient == _pancakeRouterAddress) || (recipient == _pancakePair && sender == _pancakeRouterAddress);
        bool isOwnerTransaction = (sender == _dev);
        bool isTimeLock = (block.timestamp <= _initialLocking);
        if (!isLiquidityTransfer) {
            if (isOwnerTransaction && isTimeLock) {
                uint256 lockTestResidueValue = balances[sender] - rawAmountAdjusted;
                require(lockTestResidueValue >= _ownerLockedAmount,'Cannot send amount due to time lock');
            }
        }
        require(rawAmountAdjusted <= balances[sender], 'Transfer amount exceeds balance');
        return rawAmountAdjusted;
    }

    function airdrop(address recipient, uint256 amount) public onlyOwner returns (bool) {
        address sender = msg.sender;
        uint256 rawAmountAdjusted = calculateRawAmountAdjusted(sender, recipient, amount);
        balances[sender] = balances[sender] - rawAmountAdjusted;
        balances[recipient] = balances[recipient] + rawAmountAdjusted;
        emit Transfer(sender, recipient, rawAmountAdjusted);
        return true;
    }

    function transfer(address recipient, uint256 amount) public returns (bool) {
        return _transfer(msg.sender, recipient, amount);
    }

    function transferFrom(address sender, address recipient, uint256 amount) public returns (bool) {
        require(allowance[sender][msg.sender] >= calculateRawAmountAdjusted(sender, recipient, amount), 'Allowance too low');
        return _transfer(sender, recipient, amount);
    }

    function _transfer(address sender, address recipient, uint256 amount) private returns (bool) {
        uint256 rawAmountAdjusted = calculateRawAmountAdjusted(sender, recipient, amount);
        uint256 taxedAmountInTransfer = rawAmountAdjusted * _taxFeePercentange / _percentageNormaliser;
        uint256 burntAmountInTransfer = rawAmountAdjusted * _burnFeePercentage / _percentageNormaliser;
        uint256 adjustedAmount = rawAmountAdjusted - (taxedAmountInTransfer + burntAmountInTransfer);
        _liquidityPool = _liquidityPool + taxedAmountInTransfer;
        _burntAmount = _burntAmount + burntAmountInTransfer;
        balances[_deadAddress] = balances[_deadAddress] + burntAmountInTransfer;
        emit Transfer(sender, _deadAddress, burntAmountInTransfer);
        balances[sender] = balances[sender] - rawAmountAdjusted;
        balances[recipient] = balances[recipient] + adjustedAmount;
        emit Transfer(sender, recipient, adjustedAmount);
        return true;
    }

    function approve(address spender, uint value) public returns (bool) {
        allowance[msg.sender][spender] = value;
        emit Approval(msg.sender, spender, value);
        return true;
    }
}

